  });
  const [statee, setStatee] = React.useState({
    img:require('../images/N.png'),
    value: state.reponse['data infomation']['j'].Dvent,
  });
  const [statee1, setStatee1] = React.useState({
    img:require('../images/N.png'),
    value: state.reponse['data infomation']['j+1'].Dvent,
  });
  const [statee2, setStatee2] = React.useState({
    img:require('../images/N.png'),
    value: state.reponse['data infomation']['j+2'].Dvent,
  });
  const [statee3, setStatee3] = React.useState({
    img:require('../images/N.png'),
    value: state.reponse['data infomation']['j+3'].Dvent,
  });
  const [statee4, setStatee4] = React.useState({
    img:require('../images/N.png'),
    value: state.reponse['data infomation']['j+4'].Dvent,
  });
  const [statee5, setStatee5] = React.useState({
    img:require('../images/N.png'),
    value: state.reponse['data infomation']['j+5'].Dvent,
  }); */
  
  return (
    <View>
      <VictoryChart 
        width={420} 
        height={440}
        containerComponent={
          <VictoryVoronoiContainer labels={({ datum }) => ` ${datum.y}`}/>
        }
        animate={{
          duration: 1000,
          onLoad: { duration: 30 }
        }}
        domainPadding={3}
      >
        <VictoryScatter
          data={[
            { x: 1,y: float2int(state.reponse['data infomation']['j-5'].Vvent), z:state.reponse['data infomation']['j-5'].Dvent},
            { x: 2,y: float2int(state.reponse['data infomation']['j-4'].Vvent), z: state.reponse['data infomation']['j-4'].Dvent},
            { x: 3,y: float2int(state.reponse['data infomation']['j-3'].Vvent) ,z: state.reponse['data infomation']['j-3'].Dvent},
            { x: 4, y: float2int(state.reponse['data infomation']['j-2'].Vvent),z:state.reponse['data infomation']['j-2'].Dvent},
            { x: 5,y: float2int(state.reponse['data infomation']['j-1'].Vvent) ,z: state.reponse['data infomation']['j-1'].Dvent},
            { x: 6,y: float2int(state.reponse['data infomation']['j'].Vvent) ,z:state.reponse['data infomation']['j'].Dvent},
            { x: 7,y: float2int(state.reponse['data infomation']['j+1'].Vvent) ,z: state.reponse['data infomation']['j+1'].Dvent},
            { x: 8,y: float2int(state.reponse['data infomation']['j+2'].Vvent), z: state.reponse['data infomation']['j+2'].Dvent}
          ]}
          dataComponent={<DataPoint />}
        />
        <VictoryArea
          style={{
            data: { fill: "#9CECFB", fillOpacity: 0.3, stroke: "transparent", strokeWidth: 3.5 },
          }}  
          interpolation="natural"
          data={[
            {x: (currentDate-5)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j-5'].Vvent)},
            {x:(currentDate-4)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j-4'].Vvent)},
            {x: (currentDate-3)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j-3'].Vvent)},
            {x:(currentDate-2)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j-2'].Vvent)},
            {x: (currentDate-1)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j-1'].Vvent)},
            {x: (currentDate)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j'].Vvent)},
            {x: (currentDate+1)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j+1'].Vvent)},
            {x: (currentDate+2)+'/'+'0'+currentMonth, y: float2int(state.reponse['data infomation']['j+2'].Vvent)}]}
        />
        <VictoryAxis
          style={{
            ticks: {
              padding: 5,
            },
            tickLabels: {
              fontSize: 13,
              fontWeight:'bold',
            },
          }}
        />
        {/* Vertical */}
        <VictoryAxis
          dependentAxis
          style={{
            ticks: {
              // padding: 5,
            },
            tickLabels: {
              fontSize: 13,
              fontWeight:'bold',
              color:'red'
            },
          }}
        />
      </VictoryChart>
    </View>
  );

  const { x, y,datum } = props;
    useEffect(() =>{
      console.log(datum.y);
    });
  }

export default GraphVent;

